                      Simply Pizza .
                    </Typography>
            </Box>
            </div>
            {/* <div id="triangle" className={classNames("triangle")}></div> */}
            <div></div>
            <div class="center" style={{
            position: "relative",
            zIndex: 1
          }}>
            <div class="neon-box"></div>
            </div>
            <div class="center" style={{
            position: "relative",
            zIndex: 2,
            top: "-660px"
          }}>
            <div class="shadow2">
            <div class="triangle-wrapper">
                <div class="triangle">
                    <p id="kordell"></p>
                    <p id="kordell"></p>
                    <p id="kordell"></p>
